import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom"; // Import Router and Route
import Adminhome from "./Adminhome";
import Adminresister from "./Adminresister";
import Adminlogin from "./Adminlogin";
import Admingmail from "./Admingmail";
import Adminpassword from "./Adminpassword";

export default function App() {
  return (
    <Router> {/* Wrap everything in Router */}
      <div>
        shubham app
        <Switch> {/* Switch ensures only one route is rendered */}
          <Route exact path="/adminhome" component={Adminhome} />
          <Route exact path="/adminresister" component={Adminresister} />
          <Route exact path="/adminlogin" component={Adminlogin} />
          <Route exact path="/admingmail" component={Admingmail} />
          <Route exact path="/adminpassword" component={Adminpassword} />
        </Switch>
      </div>
    </Router>
  );
}
